import React, {useState} from 'react';
import {
  View,
  Text,
  FlatList,
  Image,
  TouchableOpacity,
  Button,
  StyleSheet,
  Alert,
} from 'react-native';
import { Storage } from 'aws-amplify'; // AWS Amplify Storage to interact with S3
import Amplify from 'aws-amplify';
//import awsconfig from './aws-exports'; // Your generated AWS config

// Configure AWS Amplify with your settings
//Amplify.configure(awsconfig);

const ImageList = () => {
  const [images, setImages] = useState([
    {id: '1', uri: "data:image/jpeg;base64,"},
    {id: '2', uri: "data:image/jpeg;base64,"},
    {id: '3', uri: "data:image/jpeg;base64,"},
    {id: '4', uri: "data:image/jpeg;base64,"},
    {id: '5', uri: "data:image/jpeg;base64,"},
  ]);
  const [selectedImages, setSelectedImages] = useState([]);

  // Toggle selection of images
  const toggleSelection = id => {
    if (selectedImages.includes(id)) {
      setSelectedImages(selectedImages.filter(imageId => imageId !== id));
    } else {
      setSelectedImages([...selectedImages, id]);
    }
  };

  // Upload selected images to S3
  const uploadImagesToS3 = async () => {
    if (selectedImages.length === 0) {
      Alert.alert('No Images Selected', 'Please select images to upload.');
      return;
    }

    selectedImages.forEach(async imageId => {
      const image = images.find(img => img.id === imageId);

      // Fetch the image file (if it's a local image, you will handle it differently)
      const file = await fetch(image.uri);
      const blob = await file.blob();

      // Upload image to S3
      Storage.put(`uploads/${new Date().getTime()}-${imageId}.jpg`, blob, {
        contentType: 'image/jpeg',
      })
        .then(result => {
          console.log('Upload Success:', result);
          Alert.alert('Upload Success', `Image uploaded successfully!`);
        })
        .catch(err => {
          console.error('Upload Error:', err);
          Alert.alert('Upload Failed', 'Image failed to upload.');
        });
    });

    // Clear selected images after upload
    setSelectedImages([]);
  };

  const renderImage = ({item}) => {
    const isSelected = selectedImages.includes(item.id);
    return (
      <TouchableOpacity
        style={[styles.imageContainer, isSelected && styles.selectedImage]}
        onPress={() => toggleSelection(item.id)}>
        <Image source={{uri: item.uri}} style={styles.image} />
      </TouchableOpacity>
    );
  };

  return (
    <View style={styles.container}>
      <Text style={styles.title}>Select Images to Upload</Text>
      <FlatList
        data={images}
        renderItem={renderImage}
        keyExtractor={item => item.id}
        numColumns={3}
        contentContainerStyle={styles.grid}
      />
      <Button title="Upload Selected Images" onPress={uploadImagesToS3} />
    </View>
  );
};

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: '#f8f8f8',
    padding: 10,
  },
  title: {
    fontSize: 20,
    fontWeight: 'bold',
    textAlign: 'center',
    marginVertical: 10,
    color: '#6200ee',
  },
  grid: {
    alignItems: 'center',
  },
  imageContainer: {
    margin: 5,
    borderWidth: 2,
    borderColor: '#ddd',
    borderRadius: 8,
  },
  selectedImage: {
    borderColor: '#6200ee',
    borderWidth: 3,
  },
  image: {
    width: 100,
    height: 100,
    borderRadius: 8,
  },
});

export default ImageList;
